import './App.css';
import { SearchBar } from './components/SearchBar';
import React,{useState} from 'react'

function App() {
  const [style,setStyle]=useState(false)
  const handlerStyle=()=>{
    setStyle(!style)
  }
  return (
    <div className="App">
      <div className="header">
        <div className="header_title">
          devfinder
        </div>
        <div>
          <button onClick={handlerStyle}></button>
        </div>
      </div>
      <SearchBar></SearchBar>
    </div>
  );
}

export default App;
